export default (function(a,b,c,d,e){return {data:{VKBPessJ4W:{data:{id:462,attributes:{imdbId:"tt0046722",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTQxODllY2YtMDk3Yi00ZTY3LWFkNzgtMmMwYjZhNTlmZjU5XkEyXkFqcGdeQXVyNTUxODQ0MDk@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"}],item_lang:{data:{id:1125,attributes:{title:c,plot:"Army deserter Bart Laish decides that the best way for him to get away is to join a wagon train headed for Oregon. They're about a week ahead of him and on the trail Bart comes across an old friend, Major Andy Pepperis who is dying from wounds received in an Indian attack. He warns Bart that the Indians will next attack the wagon train and afterward finds the army station, Camp Taylor, destroyed. He assumes Pepperis' identity and catches up to the wagon train taking command of the soldiers escorting it. He proves to be a capable leader and quickly gains everyone's respect. As they get closer to their destination, Bart is closer to being caught and has to decide if and when he will leave them.",slug:"arrow-in-the-dust"}}},books:{data:[{id:3644,attributes:{title:c,description:"Bart Laish was a lifelong gambler. Now on the run, he stumbles onto a wagon train in trouble with 70 fumbling recruits to fight off 1000 vengence crazed Indians. The odds don't look good, but he is a gambler ...",thumbnail:a,authors:[b,d],firstBook:true,published:"2006-01-01",publisher:a,subtitle:a}},{id:3645,attributes:{title:"The Road to San Jacinto",description:"Why were Dain Galway and Cleo hunted like animals? Dain was prepared to meet trouble and protect them both with his gun. Why were the two fugitives constantly forced to hide? Only Cleo could answer, for the secret was hidden in her birth.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UBEi7Sd2bYUC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2004-01-01",publisher:"Gunsmoke Westerns",subtitle:a}},{id:3646,attributes:{title:"Don Desperado",description:"Connegan’s buddy had just been shot. Now, Con faced the smoking guns. If you’re waiting for me to break down and beg, you’re wasting your time! Go ahead and shoot. The killer snarled, We don’t shoot guys like you. You’re going to die slow like. Con’s brother had been branded a thief, then mysteriously disappeared. Con loaded his guns and saddled his pony, hell bent for vengeance. But there were some varmints who didn’t want his brother found. And now they had him under their guns. Would Con pay with his life before he could clear his brother’s name? Desperado’s Gold bristles with the fever-ridden excitement in its swirling episodes of Indian massacres, guerrilla warfare, and battle madness.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yRwFt93kBXoC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,d],firstBook:e,published:"2003-01-01",publisher:"Center Point Pub",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940933446}}("","L. L. Foreman","Arrow in the Dust","Leonard London Foreman",null))